import React, { useState } from "react";
import Box from "@mui/material/Box";
import { Select, MenuItem, InputLabel, FormControl } from "@mui/material";

const SortBy = (props) => {
    const [selectedSort, setSort] = useState("");

    const handleSortChange = (event) => {
        setSort(event.target.value);
      };

    return (
        <FormControl
          sx={{
            left: 40,
            borderRadius: "15px",
            "& .MuiOutlinedInput-root": {
              borderRadius: "20px",
              "& fieldset": {
                borderColor: "transparent",
              },
              "&:hover fieldset": {
                borderColor: "transparent",
              },
              "&.Mui-focused fieldset": {
                borderColor: "transparent",
              },
            },
            backgroundColor: "white",
          }}
          required="required"
        >
          <InputLabel id="sort-by">Sort by</InputLabel>
          <Select
            labelId="sort-by"
            id="sort-by"
            defaultValue=""
            style={{ width: 330 }}
            value={selectedSort}
            onChange={handleSortChange}
          >
            { props.page === "project-connect" ? ( <MenuItem key="start-date" value="start-date">
              Project Connect
            </MenuItem>) : ( props.page === "past-projects" ? ( <MenuItem key="start-date" value="start-date">
              Past proj
            </MenuItem>) : ( <MenuItem key="start-date" value="start-date">
              Available tech
            </MenuItem>))}
          </Select>
        </FormControl>
    )
}

export default SortBy
